INSERT INTO `berita` VALUES (4, 'Wali Kota Ikuti Peringatan Hari Kesaktian Pancasila 1 Oktober 2020', '<p><span style=\"color: rgb(130, 130, 130); font-family: Rubik, sans-serif; font-size: 15px;\">Wali Kota Mataram menghadiri acara peringatan Hari Kesaktian Pancasila 1 Oktober 2020 bertempat di Aula Pendopo Wali Kota Mataram yang terhubung dengan Monumen Pancasila Sakti, Kawasan Lubang Buaya, Jakarta Timur, melalui Video Conference.</span><br></p>', '/uploads/berita/1603165758xfq8T4lOloqTKzof.jpg', 'Administrator', NULL, '2020-10-20 04:49:18', '2020-10-20 04:49:18');
INSERT INTO `berita` VALUES (5, 'Kantin SMPN 2 Mataram Mulai Berlakukan Non Tunai', '<p><span style=\"font-size: 1rem;\">Kantin SMPN 2 Mataram mulai melayani siswa yang berbelanja dengan menggunakan transakasi non tunai, begitu pula juga dengan koperasi. Transaksi menggunakan non tunia ni sebagai salah satu upaya SMPN</span><br></p>', '/uploads/berita/1603166129Jh7ZnuUpIav4w0C7.jpg', 'Administrator', NULL, '2020-10-20 04:55:29', '2020-10-20 04:55:29');
INSERT INTO `berita` VALUES (6, 'SMP 2 Mataram Umumkan Kelulusan Via WhatsAPP', '<p><span style=\"color: rgb(130, 130, 130); font-family: Rubik, sans-serif; font-size: 15px;\">Menyikapi pandemi Covid-19, pengumuman kelulusan SMP digelar dengan cara yang sangat sederhana. ”Alhamdulillah, kami sudah umumkan hasilnya lewat grup WA forum kelas,” kata Kepala SMPN 2 Mataram Muhammad Nazuhi.</span><br></p>', '/uploads/berita/1603166144MgHHiXoZ8n2paDxG.jpg', 'Administrator', NULL, '2020-10-20 04:55:44', '2020-10-20 04:55:44');
INSERT INTO `berita` VALUES (7, 'Wagub Rohmi Hadiri HUT Spendu Mataram ke-60', '<p>Lingkungan menjadi salah satu bagian yang \r\nsangat penting dari kehidupan manusia. Oleh karenanya, Wakil Gubernur \r\nNusa Tenggara Barat (NTB), Dr. Hj. Sitti Rohmi Djalilah terus \r\nmengingatkan dan mengimbau masyarakat untuk tetap menjaga lingkungan \r\nserta alam sekitar. Imbauan ini pun disampaikan juga kepada alumni SMPN 2\r\n Mataram saat merayakan HUT Spendu Mataram ke-60 di Pendopo Walikota \r\nMataram, Sabtu (15/2/2020).\r\n\r\n</p><p style=\"text-align:justify\">“Kita hidup di Lombok dan Sumbawa ini luar\r\n biasa indahnya, orang luar sering mengatakan Lombok Sumbawa ini \r\nsurganya dunia saking indahnya. Dan luar biasanya pusat keindahan itu \r\ntidak hanya di satu tempat saja, begitu banyak tempat indah di Lombok \r\ndan Sumbawa ini. Masak kita sia-siakan, masak kita mau cuek tentang \r\nlingkungan,” sampainya.</p>\r\n\r\n<p style=\"text-align:justify\">Banyak sekali dampak yang dirasakan akibat\r\n ketidak pedulian masyarakat terhadap lingkungan, dan tentunya \r\nmasyarakat pasti merasakan hal itu.</p>\r\n\r\n<p style=\"text-align:justify\">“Sekarang segala sesuatu, bencana-bencana \r\nyang dulu tidak pernah kita alami, kini sudah mulai dirasakan, banjir, \r\ntanah longsor. Mungkin tidak separah yang orang luar alami, tapi kalau \r\nkita cermati, sudah sangat menghawatirkan,” tururnya.</p>\r\n\r\n<p style=\"text-align:justify\">Wagub meminta agar masyarakat tidak \r\nmenunggu arahan dari pemerintah ataupun orang lain untuk bergerak \r\nmemperbaiki lingkungan. Masyarakat diimbau untuk sesegera mungkin \r\nbertindak, karena pemerintah tidak akan mampu menyelesaikan sendiri \r\ntanpa andil dari masyarakat.</p>\r\n\r\n<p style=\"text-align:justify\">“Sudah tidak bisa lagi kita menunggu untuk\r\n melakukan sesuatu, kita harus mulai dari diri kita sendiri, selangkah \r\ndemi selangkah. Jangan sampai kita menunggu pemerintah saja, menunggu \r\nteman saja, jadi kuncinya adalah mulai dari diri kita sendiri,” imbuh \r\nUmi Rohmi, sapaannya.</p>', '/uploads/berita/1605335543kfJpH8P5tqbX3ZPn.jpg', 'Administrator', 8, '2020-11-14 07:32:23', '2020-11-14 07:32:23');
INSERT INTO `berita` VALUES (8, 'Moment HUT Ke-75, Wagub Dorong SMPN 2 Mataram Terdepan dalam Pengelolaan Sampah', '<p style=\"margin-right: 0px; margin-bottom: 25px; margin-left: 0px; font-family: &quot;Libre Baskerville&quot;; font-size: 14px; font-weight: 700;\">Mataram,DS – Lingkungan menjadi salah satu bagian yang sangat penting dari kehidupan manusia. Oleh karenanya, Wakil Gubernur Nusa Tenggara Barat (NTB), Dr. Hj. Sitti Rohmi Djalilah, mengingatkan masyarakat untuk tetap menjaga lingkungan serta alam sekitar.</p><p style=\"margin-right: 0px; margin-bottom: 25px; margin-left: 0px; font-family: &quot;Libre Baskerville&quot;; font-size: 14px; font-weight: 700;\">Imbauan ini pun disampaikan kepada alumni SMPN 2 Mataram saat merayakan HUT Spendu Mataram ke-75 di Pendopo Walikota Mataram, Sabtu (15/2/2020).</p><p style=\"margin-right: 0px; margin-bottom: 25px; margin-left: 0px; font-family: &quot;Libre Baskerville&quot;; font-size: 14px; font-weight: 700;\">“Kita hidup di Lombok dan Sumbawa ini luar biasa indahnya, orang luar sering mengatakan Lombok Sumbawa ini surganya dunia saking indahnya. Dan luar biasanya pusat keindahan itu tidak hanya di satu tempat saja, begitu banyak tempat indah di Lombok dan Sumbawa ini. Masak kita sia-siakan, masak kita mau cuek tentang lingkungan,” sampainya.</p><div class=\"xkfc xkfc-clearfix xkfc-post-inline xkfc-float-center xkfc-align-center xkfc-column-1\" style=\"margin-bottom: 12px; zoom: 1; text-align: center; font-family: &quot;Libre Baskerville&quot;; font-size: 14px; font-weight: 700;\"><div id=\"xkfc-15553-1190599138\" class=\"xkfc-container xkfc-type-code \" itemscope=\"\" itemtype=\"https://schema.org/WPAdBlock\" data-adid=\"15553\" data-type=\"code\" style=\"margin-bottom: 0px;\"><div id=\"xkfc-15553-1190599138-place\"><ins class=\"adsbygoogle\" data-ad-client=\"ca-pub-4579511975598180\" data-ad-slot=\"6574887141\" data-ad-layout=\"in-article\" data-ad-format=\"fluid\" data-adsbygoogle-status=\"done\" style=\"display: 