ah tidak akan mampu menyelesaikan sendiri tanpa andil dari masyarakat.</p><p style=\"margin-right: 0px; margin-bottom: 25px; margin-left: 0px; font-family: &quot;Libre Baskerville&quot;; font-size: 14px; font-weight: 700;\">“Sudah tidak bisa lagi kita menunggu untuk melakukan sesuatu, kita harus mulai dari diri kita sendiri, selangkah demi selangkah. Jangan sampai kita menunggu pemerintah saja, menunggu teman saja, jadi kuncinya adalah mulai dari diri kita sendiri,” imbuh Umi Rohmi, sapaannya.</p>', '/uploads/berita/1605573216PgOxrlKJzDJDSdA8.jpg', 'Administrator', 8, '2020-11-17 01:33:36', '2020-11-17 01:33:36');
INSERT INTO `berita` VALUES (9, 'SMPN 2 Mataram menyelenggarakan bimtek operator PPDB', '<p><span style=\"color: rgb(85, 85, 85); font-family: Roboto, Arial, sans-serif; font-size: 17px;\">Mataram (ANTARA) - SMPN 2 Mataram, Nusa Tenggara Barat menyelenggarakan bimbingan teknis bagi para operator Penerimaan Peserta Didik Baru (PPDB) tahun ajaran 2019/2020 agar mampu memahami serta memahami sistem PPDB online.</span><br style=\"color: rgb(85, 85, 85); font-family: Roboto, Arial, sans-serif; font-size: 17px;\"><br style=\"color: rgb(85, 85, 85); font-family: Roboto, Arial, sans-serif; font-size: 17px;\"><span style=\"color: rgb(85, 85, 85); font-family: Roboto, Arial, sans-serif; font-size: 17px;\">\"Untuk operator, kami menyiapkan tiga orang dan satu orang petugas verifikasi. Dalam pelaksanaan bimbingan teknis ini, kami bekerjasama dengan PT Telkom,\" kata Kepala SMPN 2 Mataram Mukh Nazuhi, di Mataram, Jumat.</span><br style=\"color: rgb(85, 85, 85); font-family: Roboto, Arial, sans-serif; font-size: 17px;\"><br style=\"color: rgb(85, 85, 85); font-family: Roboto, Arial, sans-serif; font-size: 17px;\"><span style=\"color: rgb(85, 85, 85); font-family: Roboto, Arial, sans-serif; font-size: 17px;\">Menurutnya, pemberian bimtek kepada para petugas operator PPDB dimaksudkan untuk menjamin kelancaran proses pelaksanaan PPDB serta meminimalisir kesalahan guna menghindari hal-hal yang tidak diinginkan.</span><br style=\"color: rgb(85, 85, 85); font-family: Roboto, Arial, sans-serif; font-size: 17px;\"><br style=\"color: rgb(85, 85, 85); font-family: Roboto, Arial, sans-serif; font-size: 17px;\"><br style=\"color: rgb(85, 85, 85); font-family: Roboto, Arial, sans-serif; font-size: 17px;\"><span style=\"color: rgb(85, 85, 85); font-family: Roboto, Arial, sans-serif; font-size: 17px;\">Di sisi lain, untuk mendukung kelancaran kegiatan PPDB yang akan dimulai 1-5 Juli 2019, pihaknya juga telah meminta pihak Telkom menjaga jaringan internet tidak terputus, begitu juga dengan PLN diharapkan tidak memutuskan aliran listrik saat PPDB berlangsung.</span><br style=\"color: rgb(85, 85, 85); font-family: Roboto, Arial, sans-serif; font-size: 17px;\"><br style=\"color: rgb(85, 85, 85); font-family: Roboto, Arial, sans-serif; font-size: 17px;\"><span style=\"color: rgb(85, 85, 85); font-family: Roboto, Arial, sans-serif; font-size: 17px;\">\"Apabila hal itu terjadi, kemungkinan dilakukan penambahan waktu PPDB akan kita koordinasikan dengan kepala dinas agar tidak melanggar ketentuan yang sudah ada. Jangankan PPDB, saat ujian nasional saja bisa terjadi gangguan listrik dan internet,\" ujarnya pula.</span><br style=\"color: rgb(85, 85, 85); font-family: Roboto, Arial, sans-serif; font-size: 17px;\"><br style=\"color: rgb(85, 85, 85); font-family: Roboto, Arial, sans-serif; font-size: 17px;\"><span style=\"color: rgb(85, 85, 85); font-family: Roboto, Arial, sans-serif; font-size: 17px;\">SMPN 2 Mataram merupakan salah satu SMP yang difavoritkan masyarakat, sehingga setiap tahun selalu menjadi incaran calon peserta didik dan orang tua siswa. Padahal pemerintah tidak pernah sama sekali memberikan label sekolah favorit.</span><br style=\"color: rgb(85, 85, 85); font-family: Roboto, Arial, sans-serif; font-size: 17px;\"><br style=\"color: rgb(85, 85, 85); font-family: Roboto, Arial, sans-serif; font-size: 17px;\"><span style=\"color: rgb(85, 85, 85); font-family: Roboto, Arial, sans-serif; font-size: 17px;\">Pada tahun ajaran 2019/2020, SMPN 2 Mataram akan menerima peserta didik sebanyak 10 rombongan belajar (rombel) dengan total daya tampung 280 siswa terdiri atas 80 persen zonasi, 15 persen prestasi dan 5 persen perpindahan orang tua/wali.</span><br style=\"color: rgb(85, 85, 85); font-family: Roboto, Arial, sans-serif; font-size: 17px;\"><br style=\"color: rgb(85, 85, 85); font-family: Roboto, Arial, sans-serif; font-size: 17px;\"><span style=\"color: rgb(85, 85, 85); font-family: Roboto, Arial, sans-serif; font-size: 17px;\">Karenanya, kegiatan PPDB yang dilaksanakan mulai 1-5 Juli 2019 terbagi menjadi dua, yakni 1-2 Juli pendaftaran untuk jalur prestasi dan perpindahan orang tua/wali. Hasil kelulusan diumumkan pada Rabu (3/7) pukul 10.00 WITA.</span><br style=\"color: rgb(85, 85, 85); font-family: Roboto, Arial, sans-serif; font-size: 17px;\"><br style=\"color: rgb(85, 85, 85); font-family: Roboto, Arial, sans-serif; font-size: 17px;\"><span style=\"color: rgb(85, 85, 85); font-family: Roboto, Arial, sans-serif; font-size: 17px;\">\"Sementara pada tanggal 3-5 Juli kesempatan pendaftaran untuk jalur zonasi dan hasilnya akan diumumkan pada Sabtu (6/7) pukul 10.00 WITA,\" ujar Nazuhi.</span><br></p>', '/uploads/berita/1605584054SdtAhtrzkhaV99Vu.jpg', 'Administrator', 8, '2020-11-17 04:34:14', '2020-11-17 04:34:14');

