INSERT INTO `profil` VALUES ('Komite Sekolah', '<p>Komite Sekolah<br></p><table class=\"table table-bordered\"><tbody><tr><td>Nama</td><td>H. Lalu Mukh&nbsp;</td></tr><tr><td>Tempat Tgl Lahir</td><td><br></td></tr><tr><td>Jenis Kelamin</td><td><br></td></tr><tr><td>Agama</td><td><br></td></tr><tr><td>Pendidikan Terakhir</td><td><br></td></tr><tr><td>Pekerjaan</td><td><br></td></tr><tr><td>Jabatan</td><td><br></td></tr><tr><td>Alamat Kantor</td><td>Jln Pejanggik No. 5 Kota Mataram, Telp. 0370-632533. Kode Pos: 83324</td></tr><tr><td>Alamat Rumah</td><td><br></td></tr><tr><td><br></td><td><br></td></tr></tbody></table><p><br></p>', '/uploads/profil/1605936537luilppw6TM8WQ4j3.jpg');
INSERT INTO `profil` VALUES ('Kepala Sekolah', '<p>Kepala Sekolah</p><table class=\"table table-bordered\"><tbody><tr><td><h6><span>Nama</span></h6></td><td><h6><span>Drs. MUKH NAZUHI</span></h6></td></tr><tr><td><h6><span>Tempat Tgl Lahir</span></h6></td><td><h6><span>Rembiga, 10&nbsp; Mei&nbsp; 1961</span></h6></td></tr><tr><td><h6><span>Jenis Kelamin</span></h6></td><td><h6><span>Laki-Laki</span></h6></td></tr><tr><td><h6><span>Agama</span></h6></td><td><h6><span>Islam</span></h6></td></tr><tr><td><h6><span>Pendidikan Terakhir</span></h6></td><td><h6><span>Sarjana (S1)</span></h6></td></tr><tr><td><h6><span>Pekerjaan&nbsp;</span></h6></td><td><h6><span>PNS (GURU)</span></h6></td></tr><tr><td><h6><span>Jabatan</span></h6></td><td><h6><span>Kepala&nbsp; Sekolah</span></h6></td></tr><tr><td><h6><span>Tempat Tugas</span></h6></td><td><h6><span>SMP NEGERI 2 MATARAM</span></h6></td></tr><tr><td><h6><span>Alamat Rumah</span></h6></td><td><h6><span>JLN.&nbsp; Halmahera Gg. 10 no. 6&nbsp; Rembiga, Selaparang, Mataram,. Telp./ HP. 081288300825,. Kode pos: 83124</span></h6></td></tr><tr><td><h6><span>Alamat Kantor</span></h6></td><td><h6><span>Jln.&nbsp; Pejanggik No. 5, Kota&nbsp; Mataram,. Telp. 0370-632533,. Kode Pos: 83324.&nbsp;<br></span><span>E_mail : smp_2nmataram@yahoo.co.id<br></span><span>Web: </span><a href=\"https://smpn2mataram.sch.id/kelasvii#\" style=\"font-size: 1rem;\"><span>https://smpn2mataram.sch.id</span></a></h6></td></tr></tbody></table><p><br></p>', '/uploads/profil/1605528440lkfL5vaaRFvEytqY.jpg');
INSERT INTO `profil` VALUES ('Sejarah Sekolah', '<p align=\"center\" style=\"text-align:center\"><b>SEJARAH SINGKAT SMP NEGER 2 MATARAM</b></p><p align=\"center\" style=\"text-align: justify;\"><span style=\"font-size: 1rem;\">Berdasarkan Keputusan Menteri PK Nomor 187/SK/B/III/60 tertanggal 25 Mei 1960 menetapkan alih fungsi SGB Negeri Mataram menjadi SMPN 2 Mataram.</span><br></p><p align=\"center\" style=\"text-align: justify;\">Seiring perjalanan waktu SMPN 2 Mataram berkembang menjadi sekolah yang banyak diminati oleh masyarakat dan mempercayakan putra putrinya untuk mengenyam pendidikan di sekolah ini.</p><p align=\"center\" style=\"text-align: justify;\">Berkat kepercayaan dan dukungan tersebut, SMPN 2 terus berbenah dan menempatkan diri diantara sekolah-sekolah terbaik di pentas Nasional. Di antaranya terpilih sebagai sekolah sehat nasional, sekolah model berbudaya lingkungan, sekolah koalisi.</p><p align=\"center\" style=\"text-align: justify;\">Selain itu berbagai program bersekala nasional telah di laksanakan di sekolah ini yaitu : uji coba Kurikulum&nbsp; Berbasis Kompetensi (KBK),&nbsp; penyelenggara program pembelejaran MIPA bilingual, berkembang menjadi Sekolah Standar Nasional (SSN), dan Sekolah Rintisan Bertaraf Internasional (RSBI).</p><p align=\"center\" style=\"text-align: justify;\"><b>Fasilitas</b></p><p align=\"center\" style=\"text-align: justify;\">Berbagai fasilitas dimiliki SMPN 2 Mataram untuk menunjang kegiatan belajar mengajar. Fasilitas tersebut antara lain:</p><ul><li style=\"text-align: justify;\">Kelas</li><li style=\"text-align: justify;\">Ruang OSIS</li><li style=\"text-align: justify;\">Aula</li><li style=\"text-align: justify;\">Perpustakaan</li><li style=\"text-align: justify;\">Laboratorium Biologi</li><li style=\"text-align: justify;\">Laboratorium Fisika</li><li style=\"text-align: justify;\">Laboratorium Komputer</li></ul>', '/uploads/profil/1603160712yot94c5yUfslp3i3.jpg');

